import React from 'react';

//app
import * as utils from 'utils';
import styles from './ClaimsAcknowledgement.styles';
import { Button, Layout, TableCell, Overflow, TableHead } from 'components';
import ClaimsFixedBottomBar from '../ClaimsFixedBottomBar/ClaimsFixedBottomBar';

//mui
import { makeStyles, Typography, Box, Table, TableRow, TableBody, Grid } from '@material-ui/core';
import AddIcon from '@material-ui/icons/Add';
import DoneIcon from '@material-ui/icons/Done';

export function ClaimsAcknowledgementView(props) {
  const { cols, claim, generateLetterChecked, handleClaim, handleFinish, claimsInformation } = props;
  const classes = makeStyles(styles, { name: 'ClaimsAcknowledgement' })();

  return (
    <>
      <div className={classes.wrapper}>
        <Layout main padding>
          <Box>
            <Typography variant="body2" className={classes.title}>
              {utils.string.t('claims.acknowledgement.letter')}
            </Typography>
            <Overflow>
              <Table data-testid="claims-table">
                <TableHead columns={cols} nestedClasses={{ tableHead: classes.tableHead }} />
                <TableBody data-testid="claims-list">
                  <TableRow hover>
                    <TableCell compact data-testid={`row-col-${claim.claimRef}`}>
                      {claimsInformation.claimReference}
                    </TableCell>
                    <TableCell compact data-testid={`row-col-${claim.firstAdvicePac}`}>
                      {/* {claim.firstAdvicePac} */}
                    </TableCell>
                    <TableCell compact data-testid={`row-col-${claim.firstAdviceDtu}`}>
                      {/* {claim.firstAdviceDtu} */}
                    </TableCell>
                    <TableCell compact data-testid={`row-col-generateLetter`}>
                      <Grid container direction="row" alignItems="center">
                        <Grid item>
                          <Typography color="secondary">{utils.string.t('claims.acknowledgement.generateLetter')}</Typography>
                        </Grid>
                        <Grid item>{generateLetterChecked && <DoneIcon color="primary" />}</Grid>
                      </Grid>
                    </TableCell>
                  </TableRow>
                </TableBody>
              </Table>
            </Overflow>
            <Button
              icon={AddIcon}
              color="primary"
              size="medium"
              text={utils.string.t('claims.acknowledgement.newClaim')}
              data-testid="handle-add-button"
              onClick={handleClaim}
              nestedClasses={{ btn: classes.claimButton }}
            />
          </Box>
        </Layout>
      </div>
      <ClaimsFixedBottomBar {...props} handleFinish={handleFinish} />
    </>
  );
}
